import React from 'react';
import {useHistory} from "react-router-dom"
import { useEffect, axios} from 'react';
import { ListTripsPage } from './ListTripsPage';


const TripDetails = () => {
  const useProtectedPage = () => {
    const history = useHistory();
  
    useEffect(() => {
      const token = localStorage.getItem("token");
  
      if (token === null) {
        console.log("Não está logado!!!");
        history.push("/login");
      }
    }, []);
  };


  useEffect(() => {
    
    const token = localStorage.getItem("token");
    axios.get(
        "https://us-central1-labenu-apis.cloudfunctions.net/labeX/mayra-carver/trip/3bUbdB1gvPzWrThpazVC",
        {
          headers: {
            auth: token
          }
        }
      )
      .then((response) => {
        console.log(response.data);
      })
      .catch((error) => {
        console.log("Deu erro: ", error.response);
      });
  }, []);
  
  useProtectedPage()

  return (
    <div>
    <p>Detalhe de uma viagem </p>
    <button onClick={goToApplicationFormPage}>Voltar</button>
    </div>
  );


};

export default TripDetails;
